import React from 'react';
import classes from './FooterList.module.css';

const Footer = (props) => (
  <>
    <li className={classes.List}>
      <a className={classes.Anchor} href={props.redirect}>
        {props.footerContent}
      </a>
      <img src={props.icon} alt={props.alt} />
    </li>
  </>
);

export default Footer;
